import logo from './logo.svg';
import './App.css';
import ReactAudioPlayer from 'react-audio-player';

// Create an object with all the songs from an album
export const albums = [
  {
    coverUrl: './assets/albumCover/GalaxyExpress.png',
    title: 'Album 1',
    artist: 'Artist 1',
    tracks: [
      {
        title: 'Track 1',
        audioUrl: 'https://example.com/track1.mp3',
      },
      {
        title: 'Track 2',
        audioUrl: 'https://example.com/track2.mp3',
      },
      // Add more tracks as needed
    ],
  },
  {
    coverUrl: './assets/albumCover/GalaxyExpress.png',
    title: 'Album 2',
    artist: 'Artist 2',
    tracks: [
      {
        title: 'Track 1',
        audioUrl: 'https://example.com/track1.mp3',
      },
      {
        title: 'Track 2',
        audioUrl: 'https://example.com/track2.mp3',
      },
      // Add more tracks as needed
    ],
  },
  // Add more albums as needed
];


const albumCover1 = require('./assets/albumCover/GalaxyExpress.png');
const trackOne = require('./assets/Albums/Galaxy Express/Emeraldes.wav');

function App() {
  return (
    <div className="container-fluid">
      <div className="row">
        <div className="col">
        <h1>Galaxy Express</h1>
        </div>
        <div className="col">
        <h2>Released : 2020</h2>
        </div>
      </div>

      <img src={albumCover1} alt="Album Cover" heigh="300px" width="300px" />
      <p>
        This is the absolute perfect project to smoke to on a sunny afternoon or super late at night in the dark while your alone. Pretty chords , dope as fuck sounds , sick mystical sounding melodies and heavy 808's. These are some of my most beautiful beats. Have fun.
      </p>
      <div>
        <p>Emeraldes</p>
      <ReactAudioPlayer
        src={trackOne}
        autoPlay
        controls
      /> 
      </div>
    </div>
  );
}

export default App;
